import React, {Component} from 'react';
import data from './data.json';

export default class Display extends React.Component
{
    render(){
        return (
            <div>{
                Object.keys(this.props).map((key)=>{
                    <h3 key={key}>{key.name}</h3>
                })
                }
               );
                </div>

        )
    }
}
